import styled from "styled-components"

const ScreenshotContainer = styled.header`
    background-color: var(--black);
    width: 73rem;
    height: 42rem;
    border-radius: 5px;
    box-shadow: 0 0 25px #FFF;
    margin: 0 auto;
    display: flex;

    & > img {
        width: 100%;
        height: auto;
        margin: auto;
    }
    `

export default function Screenshot() {
    return (
        <ScreenshotContainer>
            <img src="img/witcher.png" alt="screenshot_img" /> 
        </ScreenshotContainer>
    )
}
